      eventDescription:
        '<h2>What Are They Key Elements Of An Event Description?</h2><p>As previously mentioned, event descriptions should answer the 5 W’s and 1 H (who, what, when, where, why and how) in order to provide the most information possible. Don’t be afraid to add photos to your event description either! These pictures can be photos from past events, which are more personal to event staff and event attendees. When selecting your photos, try to avoid stock photos, as they are less compelling and may not work well with your event description.</p><ul><li>Who</li></ul><p>This key element of your event description can be interpreted in a few different ways! This can help to explain who the event is for, who is hosting the event or who should attend the event. For example, if the event is a fundraiser for a high school football team, the “who” would be the football team. In this same instance, if the Parent/Teacher Association is hosting the fundraiser for the football team, they would be the “who.” And finally, the guests who can attend the event can also be the “who.” You can market this key element by how you deem necessary.</p><ul><li>What</li></ul><p>This element is typically the title of the event, and what guests can expect out of the event. This title can also let attendees know what activities they are going to be participating in, and if they need to bring anything with them. For example, if your company is hosting a golf tournament to&nbsp;<a href="https://www.hubilo.com/blog/top-15-fundraising-event-ideas" rel="noopener noreferrer" target="_blank" style="color: var(--dark-salmon); background-color: transparent;">raise money</a>, be sure to include if they need to provide their own golf clubs.&nbsp;</p><ul><li>When</li></ul><p>Knowing when the event is taking place is one of the most important elements! The date should include days and times, and if there are any other additional dates. For example, if your event is continuous every week, be sure to include every date the event is being held. If you are having an outdoor event, you may want to think about a rain date! A rain date helps to avoid any confusion if the weather doesn’t cooperate on the original date.&nbsp;</p><ul><li>Where</li></ul><p>The location of your event is important because your guests will know exactly where to go! Events have the ability to be held both in person and online, so be sure to articulate where exactly your event will take place! If your event is in person, adding a QR code for a map will help attendees who aren’t familiar with the area. If your event is being held online, make sure to&nbsp;<a href="https://www.hubilo.com/blog/create-stunning-and-engaging-landing-pages-for-your-events-with-hubilo-landing-page-builder" rel="noopener noreferrer" target="_blank" style="color: var(--dark-salmon); background-color: transparent;">add a registration link for attendees</a>&nbsp;to follow and receive the link.</p><ul><li>Why</li></ul><p>This is the key element that explains just why the event is being held in the first place! Events can be held for any reason; to raise money, awareness or spread information. Event organizers can add a few sentences within the event description to explain why the event is being held, but not too much! You only need a few compelling sentences to capture the attention of your audience without adding too much detail.&nbsp;</p><h2>How To Write A Great Event Description - 10 Simple Steps and Tips</h2><p>When it comes to writing your event description, there are a few things to keep in mind. While you try to answer the 5 W’s, the information you deliver needs to be presented in a way that captures the reader’s attention. These 10 steps will help you write a description perfect for your event!</p><p><span style="background-color: rgb(255, 255, 255); color: rgb(51, 49, 50);">1. Define The Goal Of Your Event Description</span></p><p>As previously mentioned, events can happen for a number of reasons. When you&nbsp;<a href="https://www.hubilo.com/blog/how-to-define-event-goals-and-objectives" rel="noopener noreferrer" target="_blank" style="color: var(--dark-salmon); background-color: transparent;">define your event goals</a>, you can then define the goals for your event description. Whether your event is to raise money, launch a new campaign or gain support from the community, your event description should include all of the details needed. Once you have your goal in mind, you can then translate your company tone into the copy on the event description.</p><p><span style="background-color: rgb(255, 255, 255); color: rgb(51, 49, 50);">2. Understand Your Audience</span></p><p>At the beginning stages of your event, you need to determine who your target audience is. Once you have that audience in mind, you will have a better understanding of how to market your event to them. If your target audience are returning guests, you know how to market to them, to ensure that they will see your event description. If you need inspiration as to how to market your event to your target audience, look up other events similar to yours!</p>',
